import React from 'react';
import Header from '../components/header';

const ErrorPage = () => {
  return (
    <React.Fragment>
      <Header />
      <main>
        <h1>Page not found</h1>
      </main>
    </React.Fragment>
  );
};

export default ErrorPage;
